%[text] # Figure 1 (Methods) - Excitation lights and filters
%[text] We plot the estimated excitation light levels including the short pass filter in front of the light at 450nm in the rig. This was always present when we made the fluorescence measurements. These files are labeled ('Calib' or 'calib').
%[text]{"align":"center"} ![](text:image:955c)
%[text] 
%[text] ## Initialize ISET
ieInit;
waves = 380:4:700;
symbols = {'kx-','k*-','k^-','ko-'};
T = oeDatabaseLightsCreate;
%%
%[text] ## Brightest LED measurements (Figure 1B)
%[text] The current levels of the brightest excitation levels were selected so that the peak emission was close to the same.
files405 = ieTableGet(T,'condition','experiment','ewave',405,'elevel',980);
data405 = oeReadFiles(files405,'waves',waves);

files415 = ieTableGet(T,'condition','experiment','ewave',415,'elevel',920);
data415 = oeReadFiles(files415,'waves',waves);

files450 = ieTableGet(T,'condition','experiment','ewave',450,'elevel',870);
data450 = oeReadFiles(files450,'waves',waves);

ieFigure; %[output:9210883f]

for ii=1:size(data405,2)
    hA = semilogy(waves,data405(:,ii),'k-'); hold on; %[output:9210883f]
    set(hA,'LineWidth',2);
end
for ii=1:size(data415,2)
    hB = semilogy(waves,data415(:,ii),'k--'); %[output:9210883f]
    set(hB,'LineWidth',2);
end

for ii=1:size(data450,2)
    hC = semilogy(waves,data450(:,ii),'k:'); %[output:9210883f]
    set(hC,'LineWidth',2);
end

hold off %[output:9210883f]

grid on; xlabel('Wavelength (nm)'); ylabel('Radiance (watts/sr/nm/m^2)'); %[output:9210883f]
legend([hA,hB,hC],{'405','415','450'}); %[output:9210883f]
% title('Spectral energy in the excitation lights at max experimental intensities');
set(gca,'Fontsize',24); %[output:9210883f]
exportgraphics(gcf,'figure1B.png','Resolution',150); %[output:9210883f]
%%
[~,idx] = max(data405(:,1)); fprintf('Peak wave for 405nm: %.1f\n',waves(idx)); %[output:8041160d]
[~,idx] = max(data415(:,1)); fprintf('Peak wave for 415nm: %.1f\n',waves(idx)); %[output:82417ff7]
[v,idx] = max(data450(:,1)); fprintf('Peak wave for 450nm: %.1f\n',waves(idx)); %[output:669fb6ee]
%%
%[text] ## Estimation of unwanted reflectance
%[text] When we made the fluorescence measurements (see oeFigure1\_compareSubjects) we placed a 475nm long pass filter in front of the spectroradiometer.  Its purpose is to block the reflected light from the intense short wavelength light sources.  These were at 405, 415, and 450nm.
%[text]{"align":"center"} ![](text:image:1743)
%[text] To estimate how much light might have been reflected from the tongue and still pass through the 475nm, we  made measurements (labeled 'noisecheck') replacing the tongue/lip with a white surface.  This surface had no fluorescence, so that any light that made it through would be standard reflectance.  We estimated the maximum reflected light by taking this calibration measurement and multiplying by the standard tongue reflectance.
%%
%[text] ## Using the long pass 475nm to measure the 500-700 range
unwanted405 = ieTableGet(T,'condition','unwantedreflected','ewave',405,'elevel',980);
unwanted415 = ieTableGet(T,'condition','unwantedreflected','ewave',415,'elevel',910);
unwanted450 = ieTableGet(T,'condition','unwantedreflected','ewave',450,'elevel',870);
data405 = oeReadFiles(unwanted405,'waves',waves);
data415 = oeReadFiles(unwanted415,'waves',waves);
data450 = oeReadFiles(unwanted450,'waves',waves);

tongue = ieReadSpectra('tongue.mat',waves); 
meanTongueReflectance = mean(tongue,2);

ieFigure; %[output:05a5e9e9]
% semilogy(waves,data405,'k-',waves,data415,'k--',waves,data450,'k:'); hold on;
grid on; xlabel('Wavelength (nm)'); ylabel('Radiance (watts/sr/nm/m^2)'); %[output:05a5e9e9]
semilogy(waves,data405.*meanTongueReflectance,'k-',... %[output:05a5e9e9]
    waves,data415.*meanTongueReflectance,'k--',... %[output:05a5e9e9]
    waves,data450.*meanTongueReflectance,'k:'); %[output:05a5e9e9]
grid on; xlabel('Wavelength (nm)'); ylabel('Radiance (watts/sr/nm/m^2)');  %[output:05a5e9e9]
title('Expected tongue radiance from reflectance'); %[output:05a5e9e9]
%%
%[text] ## Plot an example tongue spectral fluorescence for Figure 1D
%[text] Choose one of the 415nm excitations
T = oeDatabaseCreate;
%%
fWave = 500:700;

files415 = ieTableGet(T,...
    'substrate','tongue', ...
    'subject','D',...
    'ewave',415, ...
    'elevel',910);
data415 = oeReadFiles(files415,'waves',fWave);

hdl = plotRadiance(fWave,mean(data415,2),'Color','k'); hold on; %[output:089e2192]
set(gca,'yscale','log','ylim',[1e-4,3e-3]); %[output:089e2192]
title('');  %[output:089e2192]
set(gca,'Fontsize',24); %[output:089e2192]
exportgraphics(gcf,'figure1D.png','Resolution',150) %[output:089e2192]

